import React from "react";
import "../../Services/CustomFormatations";

const Post = props => {
    return (
        <div>
            <h3>{props.post.name}</h3>
            <p>{props.post.text}</p>
            <small>{FormateDateHour(props.post.datetime)}</small>
        </div>
    );
}

export default Post;
